    },
    {
        name: "강민경",
        comment: "저도 리액트 배우고 싶어요",
    },
];


function CommentList(props){
    return (
        <div>
            <Comment name={"이인제"}  comment={"안녕하세요, 소플입니다."}/>
            <Comment name={"이성훈"}  comment={"리액트 재밌네용."}/>
        </div>
    );
}

export default CommentList;
